export const getSkillLevel = (score: number): string => {
    if (score === 10) {
      return "Maestro/a";
    } else if (score >= 8) {
      return "Esperto/a";
    } else if (score >= 4) {
      return "Intermedio/a";
    } else {
      return "Base";
    }
  };
